package com.ktw.fly.call.talk;import androidx.annotation.NonNull;public class Talking {    public String name;    @NonNull    public String userId;    public long requestTime;    public long talkLength;    public Talking(String name, @NonNull String userId, long requestTime) {        this.name = name;        this.userId = userId;        this.requestTime = requestTime;    }    @Override    public String toString() {        return "Talking{" +                "name='" + name + '\'' +                ", userId='" + userId + '\'' +                ", requestTime=" + requestTime +                ", talkLength=" + talkLength +                '}';    }}